INSERT INTO `fields` (`id`, `title`, `slug`, `user_id`, `description`, `body`, `parent_id`, `images`, `tags`, `price`, `priority`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'حفظ', 'حفظ', 40, 'حفظ تخصصی کل قرآن', '<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">حفظ تخصصی کل قرآن در 1 سال، حفظ تخصصی کل قرآن در 2 سال، حفظ تخصصی کل قرآن در 3 سال، حفظ تخصصی کل قرآن در 4 سال، حفظ تخصصی کل قرآن در 5 سال و بیشتر، حفظ ترتیبی (ویژه افراد با مشغله متوسط، حفظ سوره به سوره (ویژه افراد با مشغله زیاد، تثبیت و مرور حفظ، حفظ موضوعی به همراه تفسیر ، حفظ ویژه خردسالان</span></span></span></span></p>', 0, '{\"images\":{\"original\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/5fc798e285f3d.png\",\"300\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc798e285f3d.png\",\"600\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/600_5fc798e285f3d.png\",\"900\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/900_5fc798e285f3d.png\"},\"thumb\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc798e285f3d.png\"}', 'حفظ تخصصی کل قرآن', '0', 1, 1, '2020-12-02 10:08:43', '2020-12-07 07:16:13', NULL),
(2, 'حفظ تخصصی کل قرآن در 1 سال', 'حفظ-تخصصی-کل-قرآن-در-1-سال', 40, 'حفظ تخصصی کل قرآن در 1 سال', '<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">در این طرح، علاقه مندان می توانند، در یک سال حافظ کل قرآن شده و در کنار حفظ با ترجمه و تفسیر آیات از یک سو و تجوید و صوت و لحن از سوی دیگر، آشنا گردند.</span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">شرح مختصری از این طرح این است که در هفته اول قرآن آموزان روزانه نیم صفحه را با کمک استاد، حفظ نموده و این روند در هفته دوم یک صفحه و هفته سوم یک صفحه و نیم شده و از هفته چهارم به بعد روزانه بایستی دو صفحه از مصحف شریف را در جان خود به ودیعه بسپارند.</span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">گفتنی است که این طرح ویژه افراد مجرد 14 تا 28 سال بوده و نیازمند زمانی شبانه روزی می باشد. </span></span></span></span></p>', 1, '{\"images\":{\"original\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/5fc799205a908.png\",\"300\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc799205a908.png\",\"600\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/600_5fc799205a908.png\",\"900\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/900_5fc799205a908.png\"},\"thumb\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc799205a908.png\"}', 'حفظ تخصصی کل قرآن در 1 سال', '0', 1, 1, '2020-12-02 10:09:44', '2020-12-02 10:09:44', NULL),
(3, 'حفظ تخصصی کل قرآن در 2 سال', 'حفظ-تخصصی-کل-قرآن-در-2-سال', 40, 'حفظ تخصصی کل قرآن در 2 سال', '<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">در این طرح علاقه مندانی که مشغله متوسط یا کمی دارند، می توانند با حفظ روزانه 5، 7.5 و 10 سطر شروع کرده و در انتهاء روزانه یک صفحه از مصحف شریف را در وجود خود نهادینه سازند تا در کمتر از 2 سال حافظ کل قرآن کریم گردند. </span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">در این طرح قرآن آموزان، با ترجمه، تفسیر و تدبر در آیات آشنا شده و دوره های تجوید و صوت و لحن را نیز می توانند بگذرانند. این طرح محدودیت سنی نداشته و شرکت در آن، منوط به شرکت در دوره آزمایشی و تأیید استاد است. </span></span></span></span></p>', 1, '{\"images\":{\"original\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/5fc7996e6470f.png\",\"300\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc7996e6470f.png\",\"600\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/600_5fc7996e6470f.png\",\"900\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/900_5fc7996e6470f.png\"},\"thumb\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc7996e6470f.png\"}', 'حفظ تخصصی کل قرآن در 2 سال', '0', 1, 1, '2020-12-02 10:11:02', '2020-12-09 04:16:09', NULL),
(4, 'حفظ تخصصی کل قرآن در 3 سال', 'حفظ-تخصصی-کل-قرآن-در-3-سال', 40, 'حفظ تخصصی کل قرآن در 3 سال', '<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">در این طرح علاقه مندان می توانند با حفظ روزانه 10 سطر از مصحف شریف، حدودا در سه سال حافظ کل قرآن گردند. </span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">در این طرح نیز قرآن آموزان با ترجمه، تفسیر و تدبر در آیات آشنا شده و دوره های تجوید و صوت و لحن را می گذرانند. این طرح محدودیت سنی نداشته و شرکت و ادامه در کلاس های آن منوط به تأیید استاد است. </span></span></span></span></p>', 1, '{\"images\":{\"original\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/5fc7999dce682.png\",\"300\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc7999dce682.png\",\"600\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/600_5fc7999dce682.png\",\"900\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/900_5fc7999dce682.png\"},\"thumb\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc7999dce682.png\"}', 'حفظ تخصصی کل قرآن در 3 سال', '0', 1, 1, '2020-12-02 10:11:50', '2020-12-02 10:11:50', NULL),
(5, 'حفظ تخصصی کل قرآن در 4 سال', 'حفظ-تخصصی-کل-قرآن-در-4-سال', 40, 'حفظ تخصصی کل قرآن در 4 سال', '<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">در این طرح علاقه مندان می توانند، با حفظ روزانه هفت سطر و نیم از مصحف شریف در مدت تقریبا 4 سال حافظ کل قرآن کریم گردند. </span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">در این طرح نیز قرآن آموزان با ترجمه، تفسیر و تدبر در آیات آشنا شده و دوره های تجوید و صوت و لحن را می گذرانند. این طرح محدودیت سنی نداشته و شرکت و ادامه در کلاس های آن منوط به تأیید استاد است. </span></span></span></span></p>', 1, '[]', 'حفظ تخصصی کل قرآن در 4 سال', '0', 1, 1, '2020-12-02 10:12:22', '2020-12-02 10:12:22', NULL),
(6, 'حفظ تخصصی کل قرآن در 5 سال و بیشتر', 'حفظ-تخصصی-کل-قرآن-در-5-سال-و-بیشتر', 40, 'حفظ تخصصی کل قرآن در 5 سال و بیشتر', '<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">در این طرح علاقه مندان می توانند، با حفظ روزانه 5 سطر از مصحف شریف یا کمتر در مدت نزدیک به 5 سال یا بیشتر (طبق میزان حفظ) حافظ کل قرآن کریم گردند. </span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">در این طرح نیز قرآن آموزان با ترجمه، تفسیر و تدبر در آیات آشنا شده و دوره های تجوید و صوت و لحن را می گذرانند. این طرح محدودیت سنی نداشته و شرکت و ادامه در کلاس های آن منوط به تأیید استاد است. </span></span></span></span></p>', 1, '[]', 'حفظ تخصصی کل قرآن در 5 سال و بیشتر', '0', 1, 1, '2020-12-02 10:13:08', '2020-12-02 10:13:08', NULL),
(7, 'حفظ ترتیبی (ویژه افراد با مشغله متوسط)', 'حفظ-ترتیبی-ویژه-افراد-با-مشغله-متوسط', 40, 'حفظ ترتیبی (ویژه افراد با مشغله متوسط)', '<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">این طرح، ویژه افرادی بوده که مشغله آن ها متوسط می باشد، در این طرح افراد بیشتر همراه با استاد آیات را حفظ می نمایند و میزان حفظ آن ها جلسه ای است و نه روزانه.</span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">در این طرح قرآن آموزان تنها با ترجمه و مفهوم کلی آیات آشنا شده و در جلسات تدبر نیز می توانند شرکت داشته باشند.</span></span></span></span></p>', 1, '{\"images\":{\"original\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/5fc79a1684cfa.png\",\"300\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc79a1684cfa.png\",\"600\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/600_5fc79a1684cfa.png\",\"900\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/900_5fc79a1684cfa.png\"},\"thumb\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc79a1684cfa.png\"}', 'حفظ ترتیبی (ویژه افراد با مشغله متوسط):', '0', 1, 1, '2020-12-02 10:13:50', '2020-12-09 07:22:58', NULL),
(8, 'حفظ سوره به سوره (ویژه افراد با مشغله زیاد)', 'حفظ-سوره-به-سوره-ویژه-افراد-با-مشغله-زیاد', 40, 'حفظ سوره به سوره (ویژه افراد با مشغله زیاد)', '<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">حفظ سوره به سوره ویژه افرادی است که مشغله زیاد دارند مع الوصف، علاقه مند به فراگیری ترجمه و تفسیر آیات به همراه حفظ آسان نیز هستند.</span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">در این طرح، قرآن آموزان، هر جلسه مقدار کمی از آیات را حفظ نموده ولی با ترجمه و تفسیر آیات آشنا شده و تدبر در معارف الهی را در برنامه خود دارند. </span></span></span></span></p>', 1, '{\"images\":{\"original\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/5fc79a3a3ab3c.jpg\",\"300\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc79a3a3ab3c.jpg\",\"600\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/600_5fc79a3a3ab3c.jpg\",\"900\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/900_5fc79a3a3ab3c.jpg\"},\"thumb\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc79a3a3ab3c.jpg\"}', 'حفظ سوره به سوره (ویژه افراد با مشغله زیاد)', '0', 1, 1, '2020-12-02 10:14:26', '2020-12-02 10:14:26', NULL),
(9, 'تثبیت و مرور حفظ', 'تثبیت-و-مرور-حفظ', 40, 'تثبیت و مرور حفظ', '<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">این طرح، ویژه حافظان قرآن است که نیازمند تثبیت و مرور محفوظات، تحت نظر استاد می باشند. در این طرح علاقه مندان، با شرکت در کلاس ها می توانند، علاوه بر تثبیت و مرور محفوظات، اگر در بخش ترجمه و تجوید و صوت و لحن، در خود نیاز کار بیشتر می بینند، به تکمیل معلومات خود بپردازند. </span></span></span></span></p>', 1, '{\"images\":{\"original\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/5fc79a555af96.png\",\"300\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc79a555af96.png\",\"600\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/600_5fc79a555af96.png\",\"900\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/900_5fc79a555af96.png\"},\"thumb\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc79a555af96.png\"}', 'تثبیت و مرور حفظ', '0', 1, 1, '2020-12-02 10:14:53', '2020-12-02 10:14:53', NULL),
(10, 'حفظ موضوعی به همراه تفسیر', 'حفظ-موضوعی-به-همراه-تفسیر', 40, 'حفظ موضوعی به همراه تفسیر', '<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">افرادی که مایلند به صورت موضوعی از معارف قرآن کریم بهره مند شوند، می توانند با شرکت در این طرح، به صورت موضوعی آیات را حفظ نموده و طبق کتب تفسیر موضوعی قرآن کریم که توسط استاد، انتخاب و تدریس می گردد، با معارف بلند و ژرف آیات کریمه قرآن کریم آشنا گردند.</span></span></span></span></p>', 1, '{\"images\":{\"original\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/5fc79a6d518e2.png\",\"300\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc79a6d518e2.png\",\"600\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/600_5fc79a6d518e2.png\",\"900\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/900_5fc79a6d518e2.png\"},\"thumb\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc79a6d518e2.png\"}', 'حفظ موضوعی به همراه تفسیر', '0', 1, 1, '2020-12-02 10:15:17', '2020-12-02 10:15:17', NULL),
(11, 'حفظ ویژه خردسالان', 'حفظ-ویژه-خردسالان', 40, 'حفظ ویژه خردسالان', '<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">در این طرح، خردسالانی که کمتر از 7 سال دارند و دوره های روخوانی و شناخت حروف الفباء را گذرانده اند، می توانند همراه با شعر، نقاشی و آشنایی با قصص قرآن متناسب با سن خود، سوره های قرآن را نیز حفظ نمایند. </span></span></span></span></p>', 1, '{\"images\":{\"original\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/5fc79a8fb6677.png\",\"300\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc79a8fb6677.png\",\"600\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/600_5fc79a8fb6677.png\",\"900\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/900_5fc79a8fb6677.png\"},\"thumb\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc79a8fb6677.png\"}', 'حفظ ویژه خردسالان', '0', 1, 1, '2020-12-02 10:15:52', '2020-12-02 10:15:52', NULL),
(12, 'تفسیر', 'تفسیر', 40, 'تفسیر', '<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">کاربر گرامی، اگر مایل به یادگیری مفاهیم تفسیری قرآن هستید، می توانید در یکی از طرح های ذیل ثبت نام کرده و با تفسیر قرآن به صورت تخصصی و عمومی آشنا گردید.</span></span></span></span></p>', 0, '{\"images\":{\"original\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/5fc79ab51b954.png\",\"300\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc79ab51b954.png\",\"600\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/600_5fc79ab51b954.png\",\"900\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/900_5fc79ab51b954.png\"},\"thumb\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc79ab51b954.png\"}', 'تفسیر', '0', 1, 1, '2020-12-02 10:16:29', '2020-12-02 10:16:29', NULL),
(13, 'تفسیر ترتیبی', 'تفسیر-ترتیبی', 40, 'تفسیر ترتیبی', '<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">به آن دسته از کتب تفسیری که مفسر از ابتدا تا انتهای قرآن به ترتیب، به تفسیر آیات همت گماشته، تفسیر ترتیبی می گویند.</span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">در دوره های تفسیر ترتیبی، علاقه مندان با کلیات معارف تفسیری قرآن، انواع روش های تفسیری، شیوه های درست تفسیر قرآن کریم ، تاریخ تفسیر و ... آشنا شده و همراه با تدریس استاد، به خواندن متون تفسیری می پردازند. </span></span></span></span></p>', 12, '[]', 'تفسیر ترتیبی', '0', 1, 1, '2020-12-02 10:16:59', '2020-12-02 10:16:59', NULL),
(14, 'تفسیر موضوعی', 'تفسیر-موضوعی', 40, 'تفسیر موضوعی', '<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">تفسیر موضوعی آن است که مفسر از قرآن کریم موضوعاتی را استخراج و آیات مرتبط را گردآوری و تفسیر می نمایند.</span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">علاقه مندان به فراگیری تفسیر موضوعی قرآن کریم می توانند با شرکت در این دوره، طبق یکی از کتب تفسیر موضوعی قرآن کریم که توسط استاد مشخص می گردد، با تفسیر موضوعات جالب و حائذ اهمیت آشنا گردند. </span></span></span></span></p>', 12, '{\"images\":{\"original\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/5fc79aedd52c2.png\",\"300\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc79aedd52c2.png\",\"600\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/600_5fc79aedd52c2.png\",\"900\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/900_5fc79aedd52c2.png\"},\"thumb\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc79aedd52c2.png\"}', 'تفسیر موضوعی', '0', 1, 1, '2020-12-02 10:17:26', '2020-12-02 10:17:26', NULL),
(15, 'تدبر', 'تدبر', 40, 'تدبر', '<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">علاقه مندان به فکر و اندیشه در آیات و معارف آسمانی که از ناحیه قرآن و عترت به ما رسیده است می توانند، با شرکت در کلاس های تدبر، تحت نظر استاد، درست فهمی و عمیق فهمی را با توجه به تفسیر آیات و روایات، در بستر اندیشه و تدبر خودشان تجربه نمایند.</span></span></span></span></p>', 0, '{\"images\":{\"original\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/5fc79b1052dfd.png\",\"300\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc79b1052dfd.png\",\"600\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/600_5fc79b1052dfd.png\",\"900\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/900_5fc79b1052dfd.png\"},\"thumb\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc79b1052dfd.png\"}', 'تدبر', '0', 1, 0, '2020-12-02 10:18:00', '2020-12-09 07:23:18', NULL),
(16, 'تجوید', 'تجوید', 40, 'تجوید', '<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">آن چیزی که در کشور عزیز ما جمهوری اسلامی ایران مرسوم است، یادگیری دانش تجوید قرآن کریم در دو سطح است.</span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">علاقه مندان می توانند در این کلاس، به صورت علمی و تخصصی با تجوید سطح1 و 2 و نیز دوره های فراتجویدی آشنا گردند.</span></span></span></span></p>', 0, '{\"images\":{\"original\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/5fc79b3ccc8aa.jpg\",\"300\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc79b3ccc8aa.jpg\",\"600\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/600_5fc79b3ccc8aa.jpg\",\"900\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/900_5fc79b3ccc8aa.jpg\"},\"thumb\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc79b3ccc8aa.jpg\"}', 'تجوید', '0', 1, 1, '2020-12-02 10:18:45', '2020-12-02 10:18:45', NULL),
(17, 'صوت و لحن', 'صوت-و-لحن', 40, 'صوت و لحن', '<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">علاقه مندان به فراگیری علوم موسیقایی قرآن کریم، متناسب با سن و معلومات خود می توانند با مفاهیم و اصطلاحات صوت همراه با فراگیری نغمات اصلی، فرعی و ترکیبی در قالب ترتیل و تلاوت مجلسی قرائت قرآن کریم آشنا شده و گامی بلند و مؤثر را در جهت قاری شدن و زیبا خواندن قرآن کریم بردارند.</span></span></span></span></p>', 0, '[]', 'صوت و لحن', '0', 1, 1, '2020-12-02 10:19:06', '2020-12-02 10:19:06', NULL),
(18, 'اذان', 'اذان', 40, 'اذان', '<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">گلبانگ ملکوتی اذان که اذن ورود به بارگاه ملکوتی معشوق است، بایستی عاشقانه و به زیباترین وجه به ترنم در آید، لذا مؤذنین عزیز می توانند با شرکت در کلاس های تخصصی اذان، با سبک های مختلف اذان آشنا شده و علاوه بر فراگیری تجوید اذان، الحان گوناگون اذان گویی را فراگیرند. </span></span></span></span></p>', 0, '{\"images\":{\"original\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/5fc79b6c64637.png\",\"300\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc79b6c64637.png\",\"600\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/600_5fc79b6c64637.png\",\"900\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/900_5fc79b6c64637.png\"},\"thumb\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc79b6c64637.png\"}', 'اذان', '0', 1, 0, '2020-12-02 10:19:32', '2020-12-09 07:28:49', NULL),
(19, 'مفاهیم و فهم ترجمه', 'مفاهیم-و-فهم-ترجمه', 40, 'مفاهیم و فهم ترجمه', '<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">علاقه مندان به یادگیری مفاهیم لغات و ترجمه آیات، می توانند با شرکت در این دوره لغات اکثر قرآن کریم را به همراه یادگیری برخی از قواعد ادبیات عرب که در فهم ترجمه تأثیر دارد فراگرفته و به صورت عملی با ترجمه سوره هایی از قرآن آشنا گردند و در این راه با مسلک های مختلف مترجمان نیز آشنایی پیدا نمایند. </span></span></span></span></p>', 0, '{\"images\":{\"original\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/5fc79b82c2ebb.png\",\"300\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc79b82c2ebb.png\",\"600\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/600_5fc79b82c2ebb.png\",\"900\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/900_5fc79b82c2ebb.png\"},\"thumb\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc79b82c2ebb.png\"}', 'مفاهیم و فهم ترجمه', '0', 1, 1, '2020-12-02 10:19:55', '2020-12-02 10:19:55', NULL),
(20, 'روخوانی و روان خوانی', 'روخوانی-و-روان-خوانی', 40, 'روخوانی و روان خوانی', '<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">علاقه مندان به فراگیری روخوانی، روان خوانی و فصیح خوانی قرآن کریم می توانند در این طرح ثبت نام نموده، سپس با مشاوره و پیشنهادی که اساتید نور موعود، با توجه به سن و مشغله آن ها به آن ها ارائه می نمایند، در یکی از طرح های روخوانی تئوریک، روخوانی کل قرآن همراه با ترجمه و روخوانی به قصد حفظ شرکت نمایند. </span></span></span></span></p>', 0, '{\"images\":{\"original\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/5fc79b9f3ea01.png\",\"300\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc79b9f3ea01.png\",\"600\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/600_5fc79b9f3ea01.png\",\"900\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/900_5fc79b9f3ea01.png\"},\"thumb\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc79b9f3ea01.png\"}', 'روخوانی و روان خوانی', '0', 1, 1, '2020-12-02 10:20:23', '2020-12-02 10:20:23', NULL),
(21, 'نهج البلاغه خوانی', 'نهج-البلاغه-خوانی', 40, 'نهج البلاغه خوانی', '<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">کلام گهر بار حضرت امیرالمؤمنین علیه السلام، که سید رضی آن را در کتاب شریف نهج البلاغه جمع آوری نموده، دریای ژرفیست که پویندگان خود را از آب معرفت ناب سیراب می سازد.</span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">بایسته است که مسلمانان حد اقل نهج البلاغه را خوانده و با ترجمه و شرح آن آشنا گردند، تا بتوانند علی وار زندگی کرده و همچون مولایشان به اوج کمالات راه یابند. </span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">کلاس های نهج البلاغه خوانی کلاس هاییست که، علاقه مندان می توانند با شرکت کردن در این کلاس ها، با متن نهج البلاغه آشنا شده و ترجمه و شرح آن را فراگیرند. </span></span></span></span></p>', 0, '{\"images\":{\"original\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/5fc79bc5dc469.png\",\"300\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc79bc5dc469.png\",\"600\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/600_5fc79bc5dc469.png\",\"900\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/900_5fc79bc5dc469.png\"},\"thumb\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc79bc5dc469.png\"}', 'نهج البلاغه خوانی', '0', 1, 1, '2020-12-02 10:21:02', '2020-12-07 08:58:58', NULL),
(22, 'مهدالرضا', 'مهدالرضا', 40, 'مهدالرضا', '<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">با توجه به فرمایش مقام معظم رهبری مبنی بر تقویت بنیه مهدکودک ها، قرآنکده نور موعود (عج) با همکاری آستان قدس رضوی، ویژه کودکان 4 تا 6 سال، دوره های پیش دبستان و مهد کودک را با رنگ و بوی امام رضا علیه السلام و با محوریت آموزش قرآن کریم برگزار می نماید.</span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;B Nazanin&quot;\">کلاسهای مهدالرضا علیه سلام، بستری مناسب را برای تعلیم روخوانی قرآن کریم، به سبک قصه و بازی، برای نونهالان مقطع پیش دبستانی در سراسر کشور پهناور ایران اسلامی و جهان اسلام فراهم کرده است.</span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;B Nazanin&quot;\">در این طرح در کنار آموزش روخوانی قرآن کریم، امور تربیتی خردسالان بر اساس آموزه های قرآنی و سیره اهل بیت علیهم السلام و مبانی روانشناسی کودک، پایه گذاری گردیده است.</span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;B Nazanin&quot;\">برای رسیدن به این هدف موارد زیر آموزش داده می شود:</span></span></span></span></p>\r\n\r\n<ol>\r\n	<li dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;B Nazanin&quot;\">حفظ آیات، ادعیه، احادیث تربیتی و کاربردی</span></span></span></span></li>\r\n	<li dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;B Nazanin&quot;\">حفظ گزیده ای از سوره های کوتاه جزء سی ام قرآن کریم </span></span></span></span></li>\r\n	<li dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;B Nazanin&quot;\">آشنایی با داستان های قرآنی و سیره معصومین</span></span></span></span></li>\r\n	<li dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;B Nazanin&quot;\">آشنایی با فعالیتهای ملی مذهبی</span></span></span></span></li>\r\n	<li dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;B Nazanin&quot;\">آشنایی با برخی از مفاهیم پایه پیش دبستانی، مانند : علوم، ریاضی، هنر،قوانین اجتماعی و بهداشت</span></span></span></span></li>\r\n	<li dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;B Nazanin&quot;\">آشنایی با برخی از مفاهیم دینی، مانند : نماز، نیایش و زیارت </span></span></span></span></li>\r\n</ol>', 0, '{\"images\":{\"original\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/5fc79c02117c9.png\",\"300\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc79c02117c9.png\",\"600\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/600_5fc79c02117c9.png\",\"900\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/900_5fc79c02117c9.png\"},\"thumb\":\"\\/upload\\/images\\/2020\\/12\\/fields\\/300_5fc79c02117c9.png\"}', 'مهدالرضا', '0', 1, 1, '2020-12-02 10:22:02', '2020-12-02 10:22:02', NULL),
