(37, 'متن صفحه نمایش رشته ها', 'page_fields_body', 40, 'قرآنی عزیز شما می توانید با انتخاب رشته مورد علاقه خود، توضیحات پیرامون آن رشته و نیز زیر شاخه های آن رشته را مشاهده نمایید:', '[]', 'text', 1, '2020-12-04 09:43:56', '2020-12-04 09:43:56', NULL),
