(39, 'متن باکس صفحه ثبت نام قرآن آموز', 'box_students_level_body', 40, 'چگونگی کلاسداری آنلاین در قرآنکده نور موعود', '[]', 'text', 1, '2020-12-06 09:30:05', '2020-12-06 09:31:03', NULL),
(40, 'متن  صفحه ثبت نام قرآن آموز مرحله اول - انتخاب رشته', 'page_students_level_1_body', 40, '<p>قرآنی عزیز لطفا با مطالعه بخش کلاس ها و طرح های آموزشی، پس از انتخاب نوع کلاس (آنلاین یا حضوری) رشته مورد نظر خود را انتخاب کنید:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>چند نکته :</p>\r\n\r\n<p>1- رشته هایی که با رنگ قرمز نمایش داده شده اند فعلا قابلیت ثبت نام ندارند.</p>\r\n\r\n<p>2- از هر دسته اصلی رشته تها یک زیر دسته میتوان انتخاب نمود.</p>', '[]', 'text', 1, '2020-12-06 09:31:41', '2020-12-07 07:24:50', NULL),
(41, 'متن صفحه ثبت نام قرآن آموز مرحله دوم - انتخاب رشته', 'page_students_level_2_body', 40, '<p>تکمیل کردن مشخصات فردی :</p>', '[]', 'text', 1, '2020-12-07 09:20:43', '2020-12-07 09:20:43', NULL);
