INSERT INTO `web_pages` (`id`, `title`, `slug`, `body`, `user_id`, `images`, `link`, `type`, `priority`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'dfg', 'dfg', '<p>cfd</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<figure class=\"easyimage easyimage-full\"><img alt=\"\" src=\"blob:http://127.0.0.1:8000/143a84dc-82c6-4d20-8f8d-e12314ed936f\" width=\"341\" />\r\n<figcaption></figcaption>\r\n</figure>\r\n\r\n<p>&nbsp;</p>', 5, '{\"images\":{\"original\":\"\\/upload\\/images\\/2020\\/11\\/webPages\\/5fb23a243ae3c.jpg\",\"920-380\":\"\\/upload\\/images\\/2020\\/11\\/webPages\\/920-380_5fb23a243ae3c.jpg\",\"600\":\"\\/upload\\/images\\/2020\\/11\\/webPages\\/600_5fb23a243ae3c.jpg\",\"920\":\"\\/upload\\/images\\/2020\\/11\\/webPages\\/920_5fb23a243ae3c.jpg\"},\"thumb\":\"\\/upload\\/images\\/2020\\/11\\/webPages\\/920-380_5fb23a243ae3c.jpg\"}', 'https://www.maj.ir/', 'index', 5, 1, '2020-11-16 05:06:53', '2020-11-16 05:06:56', '2020-11-16 05:06:56'),
(2, 'آشنایی با ما', 'آشنایی-با-ما', '<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">بسم الله الرحمن الرحیم</span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">قرآنکده نور موعود (عج)</span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">ذات اقدس الهی در کتاب عزیزش، خود را نور معرفی کرده: &laquo;الله نور السماوات و الارض) و از نور محض، نور ساتع و نازل می گردد، بدین جهت است که قرآنی که حبل الله المتین است، نوریست که که به صوی عالم ما نازل گردیده: &laquo;انزلنا الیکم نور مبینا&raquo; و طبق فراز پر از راز زیارت جامعه کبیره، ذوات مقدسه معصومین علیهم السلام نیز نور هستند: &laquo;انتم نور&raquo; و شما خود حدیث مفصل بخوان از این مجمل که چرا نام قرآنکده، نور گشته و نام شریف حضرت موعود ارواحنا له الفداء، نور علی نور آن قرار گرفته است.</span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">البته نام کامل قرآنکده نور موعود (عج)، مؤسسه فرهنگی قرآن و عترت گلشن نور موعود (عج) است، که در استناد گلشن به نور موعود نیز، لطایفی نهفته شده که بر صاحبان بینش، پوشیده نیست. </span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">بنابراین آستان مقدس و نورانی قرآن و عترت، گلشن و بهشتی هستند از جنس نور، که ندایشان، رهایی جهانیان است، از تاریکی های حاکم بر جهان و تعلق یافتن به عالم نور.</span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">اصولا قرآن، کتابیست زندگی بخش که برای زنده ها نازل شده &laquo;لینذر من کان حی&raquo; و این کتاب عزیز همان است که به انسان، زیبایی های عالم درون و بیرون انسان را می شناساند، تا از زندگی خود بیشترین لذت را برده و به کم ها قانع نگردند. </span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">این بود نمایی کلی از جنس قرآنکده، تا قرآن آموزان بدانند که به کجا پا می نهند و قرار است به کجا پر کشند.</span></span></span></p>\r\n\r\n\r\n<p><img alt=\"\" src=\"http://127.0.0.1:8000/userfiles/files/%D8%A7%D8%B3%DA%A9%D9%86%20%D8%B1%D9%86%DA%AF%DB%8C%20%D9%85%D8%AC%D9%88%D8%B2%20%D9%81%D8%B9%D8%A7%D9%84%DB%8C%D8%AA%20%D9%85%D9%88%D8%B3%D8%B3%D9%87.jpg\" style=\"height:771px; width:1100px\" /></p>\r\n\r\n<p>&nbsp;</p>', 5, '{\"images\":{\"original\":\"\\/upload\\/images\\/2020\\/11\\/webPages\\/5fb23a39d5133.jpg\",\"920-380\":\"\\/upload\\/images\\/2020\\/11\\/webPages\\/920-380_5fb23a39d5133.jpg\",\"600\":\"\\/upload\\/images\\/2020\\/11\\/webPages\\/600_5fb23a39d5133.jpg\",\"920\":\"\\/upload\\/images\\/2020\\/11\\/webPages\\/920_5fb23a39d5133.jpg\"},\"thumb\":\"\\/upload\\/images\\/2020\\/11\\/webPages\\/920-380_5fb23a39d5133.jpg\"}', '/show/page/2', 'index', 3, 1, '2020-11-16 05:07:14', '2020-12-06 05:46:32', NULL),
(3, 'ارتباط با ما', 'ارتباط-با-ما', '<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">بسم الله الرحمن الرحیم</span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">کاربر گرامی شما می توانید، از طرق ذیل با ما در ارتباط باشید:</span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">آدرس: استان فارس، شهرستان ارسنجان، خیابان سعیدیه کوچه مهدیه طبقه پایین مهدیه مؤسسه فرهنگی قرآن و عترت گلشن نور موعود (عج) کد پستی: 7376161359</span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">شماره ثابت قرآنکده: 07143529198</span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">مدیریت: 09171260316</span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">معاونت: 09365366538</span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">پشتیبان ثبت نام و کلاسداری آنلاین: 09176849783</span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">مهد الرضا: 09338437102</span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">پست الکترونیکی:</span> <a href=\"mailto:gnm.9198@gmail.com\" style=\"color:#0563c1; text-decoration:underline\">gnm.9198@gmail.com</a></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">اینستاگرام: </span><a href=\"https://www.instagram.com/quran.golshannoormouood/\" target=\"_blank\">quran.golshannoormouood</a></span></span></p>', 40, '{\"images\":{\"original\":\"\\/upload\\/images\\/2020\\/12\\/webPages\\/5fc5f69a36e8d.png\",\"920-380\":\"\\/upload\\/images\\/2020\\/12\\/webPages\\/920-380_5fc5f69a36e8d.png\",\"600\":\"\\/upload\\/images\\/2020\\/12\\/webPages\\/600_5fc5f69a36e8d.png\",\"920\":\"\\/upload\\/images\\/2020\\/12\\/webPages\\/920_5fc5f69a36e8d.png\"},\"thumb\":\"\\/upload\\/images\\/2020\\/12\\/webPages\\/920-380_5fc5f69a36e8d.png\"}', '#', 'index', 2, 1, '2020-12-01 04:24:03', '2020-12-01 04:26:32', NULL),
(4, 'شاکرانه ها و مزایای تحصیل در قرآنکده نور موعود', 'شاکرانه-ها-و-مزایای-تحصیل-در-قرآنکده-نور-موعود', '<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">قرآنکده نور موعود (عج)، بنا بر سنت حسنه خدای سبحان که:</span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">&laquo; إِنَّ هَذَا کَانَ لَکُمْ جَزَاءً وَکَانَ سَعْیُکُم مَّشْکُورًا (انسان، 22) این پاداش شماست، و سعی و تلاش شما مورد قدردانی است! &raquo; شاکرانه هایی را برای قرآن آموزان خود، تدارک نموده است:</span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">1-سفر رایگان کربلای معلی و زیارت آل الله، برای کسانی که حافظ کل قرآن گردند. </span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">2-اعطای مدرک رسمی کشوری، در هر کدام از رشته ها.</span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">3-برگزاری جشنواره های قرآنی برای قرآن آموزان.</span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">4-برگزاری مسابقات قرآنی، هنری و... </span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">5-استفاده از اساتید بین المللی و کشوری و نیز اساتیدی که دوره خاص و تخصصی معلم القرآن را گذرانده اند.</span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">6-اهدای جوایز در حین کلاس و در پایان دوره ها.</span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">7-اجرای برنامه های مستمر اخلاقی در قالب های مختلف مانند دفترچه محاسبه نفس و کلاس های اخلاق</span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">8-اردوهای زیارتی، سیاحتی و تفریحی</span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">9-اردوها و برنامه های&nbsp; روزانه و شبانه روزی تحفیظی و تحصیلی، به جهت اکمال تخصص قرآن آموزان.</span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">10- تشویق قرآن آموزان محصل در مدارس و معرفی آنان به مردم.</span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">11-راهنمایی و استعانت برای دریافت مدرک کارشناسی و کارشناسی ارشد معادل که در طی آزمونی از سمت سازمان تبلیغات به حفّاظ اعطاء می گردد.</span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">12-راهنمایی و استعانت برای دریافت مدرک کارشناسی رسمی که از طریق سازمان سنجش کشور به حفّاظ اعطاء می گردد.</span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\">&nbsp;</p>', 40, '{\"images\":{\"original\":\"\\/upload\\/images\\/2020\\/12\\/webPages\\/5fc785f833ebd.jpg\",\"920-380\":\"\\/upload\\/images\\/2020\\/12\\/webPages\\/920-380_5fc785f833ebd.jpg\",\"600\":\"\\/upload\\/images\\/2020\\/12\\/webPages\\/600_5fc785f833ebd.jpg\",\"920\":\"\\/upload\\/images\\/2020\\/12\\/webPages\\/920_5fc785f833ebd.jpg\"},\"thumb\":\"\\/upload\\/images\\/2020\\/12\\/webPages\\/920-380_5fc785f833ebd.jpg\"}', '#', 'index', 1, 1, '2020-12-02 08:48:01', '2020-12-02 08:48:01', NULL),
(5, 'چگونگی کلاسداری آنلاین در قرآنکده نور موعود', 'چگونگی-کلاسداری-آنلاین-در-قرآنکده-نور-موعود', '<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">بسم الله الرحمن الرحیم </span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">در جهان امروز همراه با پیشرفت های فناوری ارتباطات، اقبال عموم مردم جهان به فعالیت های مجازی از طریق موبایل و رایانه نیز افزایش یافته است و اینک فعالیت های مجازی چه به صورت آنلاین یا آفلاین، بستر مناسبی برای انتقال اندیشه هاست و از این جهت می توان گفت که این فضا بالواقع، مجازی نیست، بلکه حقیقی می باشد.</span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">لذا قرآنکده نور موعود (عج) نیز، در راستای &nbsp;رسالت خود، قرآنکده آنلاین را طراحی نموده، تا مشتاقان به یادگیری معارف قرآن و عترت، در همه سنین و با همه سلیقه ها و استعداد ها بتوانند زیبایی های معارف الهی را درک و وجودشان را از چشمه سار قرآن و عترت، سیراب نمایند. </span></span></span></span></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:right\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">گفتنی است که قرآنکده آنلاین نور موعود، از طریق برنامه های ارتباط آنلاین به صورت جمعی و دوطرفه است، تا قرآن آموزان عزیز بتوانند در موبایل یا رایانه خود، همانند کلاس های حضوری و با فضایی مشابه، کلاسی با کیفیت را تجربه نمایند. </span></span></span></span></p>', 40, '{\"images\":{\"original\":\"\\/upload\\/images\\/2020\\/12\\/webPages\\/5fccb86f023b1.jpg\",\"920-380\":\"\\/upload\\/images\\/2020\\/12\\/webPages\\/920-380_5fccb86f023b1.jpg\",\"600\":\"\\/upload\\/images\\/2020\\/12\\/webPages\\/600_5fccb86f023b1.jpg\",\"920\":\"\\/upload\\/images\\/2020\\/12\\/webPages\\/920_5fccb86f023b1.jpg\"},\"thumb\":\"\\/upload\\/images\\/2020\\/12\\/webPages\\/920-380_5fccb86f023b1.jpg\"}', '#', 'index', 1, 1, '2020-12-06 07:24:39', '2020-12-06 07:24:39', NULL);
